import logo from "./logo.svg";
import "./App.css";
import Register from "./compoennts/register";

function App() {
  return (
    <div className="App">
     <BrowserRouter>
                <Routes>
                    <Route
                        exact
                        path="/"
                        element={<Login />}
                    />
                    <Route
                        exact
                        path="/about"
                        element={<Signup />}
                    />
                </Routes>
            </BrowserRouter>

    </div>
  );
}

export default App;
